import React, { useState } from 'react';
import './quizresult.css'; // Ensure this file contains CSS for popup styling
import Footer from './footer';

const QuizResult = () => {
    const [selectedLoan, setSelectedLoan] = useState(null);

    const loanDetails = {
        educational: {
            title: "Educational Loan",
            description: "Information about the Educational Loan...",
            imgSrc: "educ.jpg",
        },
        personal: {
            title: "Personal Loan",
            description: "This personal loan allows individuals to borrow up to â‚±10,000 to help achieve their personal goals, such as debt consolidation, medical expenses, etc. Payable over 6 months with low interest.",
            imgSrc: "personal.jpg",
        },
        pensioner: {
            title: "Pensioner Loan",
            description: "Information about the Pensioner Loan...",
            imgSrc: "pens.jpg",
        },
    };

    const openPopup = (loanType) => {
        setSelectedLoan(loanDetails[loanType]);
    };

    const closePopup = () => {
        setSelectedLoan(null);
    };

    return (
        <div className="quiz-result">
            <header className="header">
                <img src="logo.png" alt="MSU-IIT NMPC Logo" className="logol" />
                <h2 className="landingh2off2">MSU-IIT National Multi-Purpose Cooperative</h2>
            </header>

            <div className="congrats-banner">
                <img src="cong.png" alt="Educational Loan" className="congrats-image" />
            </div>

            <div className="main-container">
                <div className="result-container">
                    <p className="greeting">Dear Charles Deo,</p>
                    <p className="qualification-message">
                        Congratulations! Youâ€™re qualified for a personal loan.
                    </p>
                    <button className="apply-loan-button">Apply personal loan</button>

                    <h3>Hereâ€™s some loan offers you can avail to:</h3>

                    <div className="loan-offers">
                        <div className="loan-card" onClick={() => openPopup('educational')}>
                            <img src="educ.jpg" alt="Educational Loan" className="loan-image" />
                            <h4>Educational Loan</h4>
                        </div>
                        <div className="loan-card" onClick={() => openPopup('personal')}>
                            <img src="personal.jpg" alt="Personal Loan" className="loan-image" />
                            <h4>Personal Loan</h4>
                        </div>
                        <div className="loan-card" onClick={() => openPopup('pensioner')}>
                            <img src="pens.jpg" alt="Pensioner Loan" className="loan-image" />
                            <h4>Pensioner Loan</h4>
                        </div>
                    </div>
                    <div className="button-container">
                        <button className="quiz-again-button">Take Quiz Again</button>
                    </div>
                </div>
            </div>

            {selectedLoan && (
                <div className="popup-overlay" onClick={closePopup}>
                    <div className="popup-box" onClick={(e) => e.stopPropagation()}>
                        <button className="close-button" onClick={closePopup}>X</button>
                        <div className='mag'> 
                        <img src={selectedLoan.imgSrc} alt={selectedLoan.title} className="popup-image" />
                        </div>
                       
                        <h3>{selectedLoan.title}</h3>
                        <p>{selectedLoan.description}</p>
                    </div>
                </div>
            )}

            <Footer />
        </div>
    );
};

export default QuizResult;
